import React from "react";
import {
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBCardHeader,
  MDBCardFooter,
  MDBContainer,
} from "mdbreact";
export default function TransactionRow({
  transaction: { date, title, image, description, amount, type, account },
}) {
  return (
    <div>
      <tr className="table-row">
        <td className="table-row-data">{date}</td>
        <td className="table-row-data-long">{description}</td>
        <td className="table-row-data">{amount}</td>
        <td className="table-row-data">{type}</td>
        <td className="table-row-data">{account}</td>
      </tr>
      <div className="col-sm">
        <MDBCard border="success" style={{ maxWidth: "18rem" }}>
          <div className="card-body">
            <MDBCardTitle tag="h5">{title}</MDBCardTitle>
            {title}

            <br />
            <img src={image} />
            <div className="card-text">{description}</div>
          </div>
        </MDBCard>
      </div>
    </div>
  );
}
